        private const string VALID_PASSWORD = "lclcmsms";
        private const string VALID_SERVER = "https://panoramaweb.org";

        [TestMethod]
        public void TestPanorama()
        {
            RunFunctionalTest();
        }

        protected override void DoTest()
        {
            var testFileBrowser = new TestPanoramaFileBrowser(VALID_SERVER, VALID_USER_NAME, VALID_PASSWORD);
            //Test navigation buttons
            TestNavigationButtons();

            //Test with no user permissions
            TestPermissions();

            //Test TargetedMS folder with no Skyline documents
            //Test with no targetedMS folders

            //Test empty JSON
            
            //Test versions: selected option is correct for all versions vs current version
            TestVersions();

            //Test checkbox switching

            //Test cancel and close
            TestCancel();

            
        }

        //Comment testing methods
        //Do not assume we're connected to server, initialize remote dialog with JSON 
        public void TestNavigationButtons()
        {
            var json =JObject.Parse(TARGETEDMS_JSON);
            var remoteDlg = ShowDialog<FilePicker>(() => 
                SkylineWindow.OpenFromPanorama(VALID_SERVER, string.Empty, string.Empty, json));

            WaitForCondition(9000, () => remoteDlg.IsLoaded);

            RunUI(() =>
            {
                remoteDlg.FolderBrowser.SelectNode("AutoQC");
                remoteDlg.FolderBrowser.SelectNode("Example Data");
                remoteDlg.FolderBrowser.SelectNode("Chromatogram Library");
                Assert.IsTrue(remoteDlg.BackEnabled());
                remoteDlg.ClickBack();
                Assert.AreEqual("Example Data", remoteDlg.FolderBrowser.Clicked.Text);
                remoteDlg.ClickBack();
                Assert.IsTrue(remoteDlg.ForwardEnabled());
                Assert.AreEqual("AutoQC", remoteDlg.FolderBrowser.Clicked.Text);
                Assert.IsFalse(remoteDlg.BackEnabled());
                remoteDlg.ClickForward();
                Assert.AreEqual("Example Data", remoteDlg.FolderBrowser.Clicked.Text);
                remoteDlg.ClickUp();
                remoteDlg.Close();
            });
            WaitForClosedForm(remoteDlg);
        }

        private void TestVersions()
        {
            var fileJson = JObject.Parse(FILE_VERSIONS);
            var json = JObject.Parse(NO_PERMISSIONS);
            var remoteDlg = ShowDialog<FilePicker>(() =>
                SkylineWindow.OpenFromPanorama(VALID_SERVER, VALID_USER_NAME, VALID_PASSWORD, json, fileJson));

            WaitForCondition(9000, () => remoteDlg.IsLoaded);

            RunUI(() =>
            {
                remoteDlg.FolderBrowser.SelectNode("Versions");
                Assert.IsTrue(remoteDlg.VersionsVisible());
                remoteDlg.Close();
            });
            WaitForClosedForm(remoteDlg);

        }

        /// <summary>
        /// Tests loading a treeView with no read permissions
        /// </summary>
        private void TestPermissions()
        {
            var json = JObject.Parse(NO_PERMISSIONS);
            var remoteDlg = ShowDialog<FilePicker>(() =>
                SkylineWindow.OpenFromPanorama(VALID_SERVER, string.Empty, string.Empty, json));

            WaitForCondition(9000, () => remoteDlg.IsLoaded);

            RunUI(() =>
            {
                Assert.AreEqual(0, remoteDlg.FolderBrowser.NodeCount);
                remoteDlg.Close();
            });
            WaitForClosedForm(remoteDlg);
        }

        private void TestCancel()
        {
            var json = JObject.Parse(TARGETEDMS_JSON);
            var remoteDlg = ShowDialog<FilePicker>(() =>
                SkylineWindow.OpenFromPanorama(VALID_SERVER, string.Empty, string.Empty, json));

            WaitForCondition(9000, () => remoteDlg.IsLoaded);

            RunUI(() =>
            {
                remoteDlg.FolderBrowser.SelectNode("AutoQC");
                remoteDlg.FolderBrowser.SelectNode("Example Data");
                remoteDlg.FolderBrowser.SelectNode("Chromatogram Library");
                remoteDlg.TestCancel();
                Assert.IsTrue(remoteDlg.FormClosed);
            });
            WaitForClosedForm(remoteDlg);
        }



